import { useState, useEffect } from 'react';
import Blogs from './components/Blogs';

const App = () => {

  const blogs = [
    {
      title: "test",
      author: "test",
      url: "test",
      likes: "1"
    }
  ]

  const titlet = blogs.map(blog => blog.title)

  return (
    <div className="App">
      <h1>Blogs</h1>
      <p>{blogs}</p>
      <Blogs />
    </div>
  );
}

export default App
